import React from 'react'
import { Particles } from "react-particles-js";
import './app.css'
import 'bootstrap/dist/css/bootstrap.min.css'
import { Container, Row, Col } from 'react-bootstrap'

export default function HomeBAW(props) {

    const greeting = () => {
        const greetings = ["Hello", "Hey", "Greetings" ]
        const random = Math.floor(Math.random() * greetings.length)
        return greetings[random]
    }

    return (
        <div className="homeBAW" id="home">
            <Particles className="resize-fix"
            params={{
                "particles": {
                    "number": {
                        "value": 40
                    },
                    "size": {
                        "value": 3,
                        "random": true
                    },
                    "color": {
                        "value":"#000000"
                    },
                    "line_linked": {
                        "enable": true,
                        "opacity": 1,
                        "color": "#474747",
                        "width": 1
                    },
                    "move": {
                        "enable": true,
                        "straight": false,

                    }
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "grab"
                        },
                    },
                    "resize": true
                }
            }} />

            <Row className="row-height-set-100">
                <Col lg={6} sm={0}>

                </Col>
                <Col lg={6} sm={12} className="d-flex justify-content-center align-items-center" >
                    <span id="hello"> {greeting()} & welcome to my personal website. </span>
                </Col>
            </Row>
        </div>
    )
}
